import React from 'react';


//If not touched or is valid, show nothing. otherwise display error.
export function FieldCheck(props) {
    if (props.isTouched || !props.isValid) {
        return (
            <div align="left">
                <h6 style={{color:'red'}}>{props.message}</h6>
            </div>
        );
    } else {
        return (<div><br/></div>);
    }
}

export function FieldCheck2(props) {
    if (!props.message) {
        return (<div><br/></div>);
    }

    return (
        <div align="left">
            <h6 style={{color:'red'}}>{props.message}</h6>
        </div>
    );
}

export function FieldCheck3(props) {
    if (props.isValid) {
        return (<div><br/></div>);
    }

    if (!props.message) {
        return (<div><br/></div>);
    }

    return (
        <div align="left">
            <h6 style={{color:'red'}}>{props.message}</h6>
        </div>
    );
}

export default FieldCheck;
